import EventItem from "./EventItem";


const EventList = ({remove, create, change, ...props}) =>
{

    return (
        <div>
            {props.events.length !== 0
            ? 
                props.events.map((event, number) =><EventItem identificate = {number} remove = {remove} change = {change} event = {event} key = {number} />)
            : 
                <h2 style={{textAlign: 'center'}}>События отсутствуют</h2>
            }
        </div>
    )
}

export default EventList;
